import Layout from "../Layout";
import "./styles.scss";

const MockData = [
    {
        id: '1',
        title: 'Post1',
        body: 'Lorem Ipsum Dolorem Ipsum Dolorem 1111'
    },
    {
        id: '2',
        title: 'Post 2',
        body: 'Lorem Ipsum Dolorem Ipsum Dolorem 2222'
    }
];

function BlogPostList() {
    return (
        <Layout>
            {MockData.map(post => {
                return <div className="post-inline">
                    <div className="title">{post.title}</div>
                    <div className="body">{post.body}</div>
                </div>
            })}
        </Layout>
    );
}

export default BlogPostList;
